DynamicMap.title:
DynamicMap will have two individual map
ActionVariableMap will look like following:
"action_variable_map": {
"<actionID>": {
"jsonpath_queries_1": {
"type": "array",
"output_variable":{
"script_query_name":{
"name": "script_query_name",
"type":"string"
},
"script_query_name_1":{
"name": "script_query_name_1",
"type":"string"
}
}
}
"jsonpath_queries_2": {
"type": "object",
"output_variable":{
"query_name":{
"name": "query_name",
"type":"string"
}
}
}
}
}
Action output table is for orchestrator to keep track of dynamic created table and table type
it will look like following:
"action_output_table": {
"<action_definition_id>": {
"<action_dynamic_property_1>": {
"table_id": "",
"table_type_id": ""
},
"<action_dynamic_property_2>": {
"table_id": "",
"table_type_id": ""
}
}
}
